import { useSelector } from 'react-redux'
import { Dot, Target } from './Target'

export default function NextMoves() {
	const { gameField, nextMoves } = useSelector((store) => store.chess)

	return nextMoves.map(([x, y]) => {

		const props = {x, y, key:`d${x}${y}`}

		return <>
			{gameField[y][x] === '0' && <Dot {...props} />}
			{gameField[y][x] !== '0' && <Target {...props} />}
		</>

	})
}
